import { Injectable } from "@angular/core";
import pdfMake from "pdfmake/build/pdfmake";
import pdfFonts from "pdfmake/build/vfs_fonts";
import * as jwt_decode from "jwt-decode";
pdfMake.vfs = pdfFonts.pdfMake.vfs;

@Injectable({
  providedIn: "root",
})
export class ExportToPdfService {
  constructor() {}

  mainLogo =
    "data:image/png;base64,";

  secondLogo =
    "data:image/png;base64,";

  header = [
    {
      text: "Nombre",
      style: "tableHeader",
      bold: true,
      fillColor: "#2a3e52",
      color: "#ffffff",
      size: 13,
    },
    {
      text: "Descripción",
      style: "tableHeader",
      alignment: "center",
      bold: true,
      fillColor: "#2a3e52",
      color: "#ffffff",
      size: 13,
    },
    {
      text: "Estatus",
      alignment: "center",
      style: "tableHeader",
      bold: true,
      fillColor: "#2a3e52",
      color: "#ffffff",
      size: 13,
    },
  ];

  generatePdf(
    reportName: string,
    header: any = this.header,
    data: any,
    alignment: string = "left",
    orientation: string = "portrait",
    mainLogo: any = this.mainLogo,
    secondLogo: any = this.secondLogo
  ) {
    // data.map((el, i) => {
    //   console.log(Object.values(el));
    // });

    pdfMake.tableLayouts = {};
    let fecha = new Date();

    let options = {
      hour: "numeric",
      minute: "numeric",
      second: "numeric",
      year: "numeric",
      month: "long",
      day: "numeric",
    };

    let finalDate = fecha.toLocaleDateString("es-ES", options);
    const tokenDecoded = jwt_decode(localStorage.getItem("token"));
    let usuario =
      tokenDecoded.persona.strNombre +
      " " +
      tokenDecoded.persona.strPrimerApellido;

    var documentDefinition = {
      pageMargins: [40, 60, 40, 40],
      pageOrientation: orientation,
      header: {
        table: {
          widths: "*",
          body: [
            [
              {
                image: secondLogo,
                alignment: "left",
                fit: [100, 100],
                width: 100,
                margin: [40, 20, 10, 15],
              },
              {
                image: mainLogo,
                alignment: "right",
                fit: [100, 100],
                width: 100,
                margin: [0, 20, 20, 15],
              },
            ],
          ],
        },
        layout: "noBorders",
      },
      footer: function (currentPage, pageCount) {
        return {
          table: {
            widths: "*",
            body: [
              [
                {
                  text: "Reporte generado por: " + usuario,
                  alignment: "left",
                  margin: [30, 0, 0, 30],
                  size: 10,
                },
                {
                  text: "Página " + currentPage.toString() + " de " + pageCount,
                  alignment: "center",
                  style: "normalText",
                  size: 10,
                },
                {
                  text: finalDate,
                  alignment: "right",
                  style: "normalText",
                  margin: [0, 0, 30, 30],
                  size: 10,
                },
              ],
            ],
          },
          layout: "noBorders",
        };
      },
      info: {
        title: reportName + ".pdf",
      },
      content: [
        {
          text: reportName,
          fontSize: 22,
          bold: true,
          margin: [0, 20, 0, 20],
        },
        {
          style: "tableExample",
          alignment: alignment,
          table: {
            headerRows: 1,
            body: [header].concat(
              data.map(
                (el, i) => Object.values(el) //TODO replace undefined
              )
            ),
          },
          layout: {
            fillColor: function (rowIndex, node, columnIndex) {
              return rowIndex % 2 === 0 ? "#CCCCCC" : null;
            },
            hLineColor: function (i, node) {
              return i === 0 || i === node.table.body.length
                ? "null"
                : "#2a3e52";
            },
            vLineColor: function (i, node) {
              return i === 0 || i === node.table.widths.length ? -0.01 : -0.01;
            },
            vLineWidth: function (i) {
              return 0;
            },
          },
          //layout: "lightHorizontalLines",
        },
      ],
    };
    pdfMake.createPdf(documentDefinition).download(reportName + ".pdf");
  }

  generatePdfExpediente(
    reportName: string,
    alumno: any = [],
    header: any = this.header,
    data: any,
    alignment: string = "left",
    orientation: string = "portrait",
    mainLogo: any = this.mainLogo,
    secondLogo: any = this.secondLogo
  ) {
    pdfMake.tableLayouts = {};
    let fecha = new Date();
    let options = {
      hour: "numeric",
      minute: "numeric",
      second: "numeric",
      year: "numeric",
      month: "long",
      day: "numeric",
    };

    let finalDate = fecha.toLocaleDateString("es-ES", options);
    const tokenDecoded = jwt_decode(localStorage.getItem("token"));
    let usuario =
      tokenDecoded.persona.strNombre +
      " " +
      tokenDecoded.persona.strPrimerApellido;

    var documentDefinition = {
      pageMargins: [40, 60, 40, 40],
      pageOrientation: orientation,
      header: {
        table: {
          widths: "*",
          body: [
            [
              {
                image: secondLogo,
                alignment: "left",
                fit: [100, 100],
                width: 100,
                margin: [40, 20, 10, 15],
              },
              {
                image: mainLogo,
                alignment: "right",
                fit: [100, 100],
                width: 100,
                margin: [0, 20, 20, 15],
              },
            ],
          ],
        },
        layout: "noBorders",
      },
      footer: function (currentPage, pageCount) {
        return {
          table: {
            widths: "*",
            body: [
              [
                {
                  text: "Reporte generado por: " + usuario,
                  alignment: "left",
                  margin: [30, 0, 0, 30],
                  size: 10,
                },
                {
                  text: "Página " + currentPage.toString() + " de " + pageCount,
                  alignment: "center",
                  style: "normalText",
                  size: 10,
                },
                {
                  text: finalDate,
                  alignment: "right",
                  style: "normalText",
                  margin: [0, 0, 30, 30],
                  size: 10,
                },
              ],
            ],
          },
          layout: "noBorders",
        };
      },
      info: {
        title: reportName + ".pdf",
      },
      content: [
        {
          text: reportName,
          fontSize: 22,
          bold: true,
          margin: [0, 20, 0, 20],
        },
        {
          text: "Nombre del alumno: " + alumno.nombre,
          fontSize: 10,
          bold: false,
          margin: [0, 0, 0, 0],
        },
        {
          text: "Matricula: " + alumno.matricula,
          fontSize: 10,
          bold: false,
          margin: [0, 0, 0, 0],
        },
        {
          text: "Correo electrónico: " + alumno.correo,
          fontSize: 10,
          bold: false,
          margin: [0, 0, 0, 20],
        },
        {
          style: "tableExample",
          alignment: alignment,
          table: {
            headerRows: 1,
            body: [header].concat(
              data.map(
                (el, i) => Object.values(el) //TODO replace undefined
              )
            ),
          },
          layout: {
            fillColor: function (rowIndex, node, columnIndex) {
              return rowIndex % 2 === 0 ? "#CCCCCC" : null;
            },
            hLineColor: function (i, node) {
              return i === 0 || i === node.table.body.length
                ? "null"
                : "#2a3e52";
            },
            vLineColor: function (i, node) {
              return i === 0 || i === node.table.widths.length ? -0.01 : -0.01;
            },
            vLineWidth: function (i) {
              return 0;
            },
          },
          //layout: "lightHorizontalLines",
        },
      ],
    };
    pdfMake.createPdf(documentDefinition).download(reportName + ".pdf");
  }
}

